import React from 'react';
import ReactDOM from 'react-dom';
import './App.css';
import Button from '@material-ui/core/Button';

// render every component for the web app
function App() {
  return (
    <Button variant="contained" color="primary">
      Hello World
    </Button>
  );
}

export default App;
